description:
Este medicamento é indicado como analgésico (para dor) e antitérmico (para febre).

Este medicamento não deve ser utilizado caso você tenha:
- reações alérgicas, tais como reações cutâneas graves com este medicamento;
- alergia ou intolerância à dipirona ou a qualquer um dos componentes da formulação ou a outras pirazolonas ou a pirazolidinas (ex.: fenazona, propifenazona, isopropilaminofenazona, fenilbutazona, oxifembutazona) incluindo, por exemplo, experiência prévia de agranulocitose (diminuição acentuada na contagem de glóbulos brancos do sangue) com uma destas substâncias;
- função da medula óssea prejudicada (ex.: após tratamento citostático) ou doenças do sistema hematopoiético (responsável pela produção das células sanguíneas);
- desenvolvido broncoespasmo (contração dos brônquios levando a chiado no peito) ou outras reações anafilactoides, como urticária (erupção na pele que causa coceira), rinite (irritação e inflamação da mucosa do nariz), angioedema (inchaço em região subcutânea ou em mucosas) depois do uso de medicamentos para dor (ex.: salicilatos, paracetamol, diclofenaco, ibuprofeno, indometacina, naproxeno);
- porfiria hepática aguda intermitente (doença metabólica que se manifesta através de problemas na pele e/ou com complicações neurológicas) pelo risco de indução de crises de porfiria;
- deficiência congênita da glicose-6-fosfato-desidrogenase (G6PD), pelo risco de hemólise (destruição dos glóbulos vermelhos, o que pode levar à anemia);
- gravidez e amamentação (vide “O que devo saber antes de usar este medicamento?”).
Este medicamento é contraindicado para menores de 3 meses de idade ou pesando menos de 5 kg.
Este medicamento não deve ser utilizado por mulheres grávidas sem orientação médica. Informe imediatamente seu médico em caso de suspeita de gravidez.

O dipropionato de betametasona + fosfato dissódico de betametasona está indicado para o tratamento de doenças agudas e crônicas que respondem aos corticoides. A terapia hormonal com corticosteroide é coadjuvante e não substitui a terapêutica convencional. 
O dipropionato de betametasona + fosfato dissódico de betametasona é indicado para os seguintes quadros clínicos: 
- Alterações osteomusculares e de tecidos moles: artrite reumatoide, doenças das articulações como: osteoartrite, bursite, espondilite anquilosante, espondilite radiculite, dor no cóccix, ciática, dor nas costas, torcicolo, exostose, inflamação na planta dos pés (fascite);
- Condições alérgicas: asma, rinite alérgica devida a pólen, edema angioneurótico (inchaço que pode afetar várias partes do organismo), bronquite alérgica, rinite alérgica persistente, hipersensibilidade à droga, doença do soro, picadas de insetos;
- Condições dermatológicas: dermatite atópica (doença alérgica da pele), líquen simples crônico, dermatite de contato, dermatite solar grave, urticária, líquen plano hipertrófico, necrobiose lipoídica associada com diabetes mellitus (espécie de úlcera que afeta diabéticos), alopecia areata (queda de cabelo), lúpus eritematoso discoide, psoríase, queloides, pênfigo, dermatite herpetiforme. 
- Doenças do colágeno: lúpus eritematoso sistêmico, esclerodermia, dermatomiosite, poliarterite nodosa (tipos de doenças auto-imunes). 
- Tumores malignos: para o tratamento paliativo de leucemias e linfomas em adultos, leucemia aguda da infância. 
- Outras condições: síndrome adrenogenital (alteração hormonal que pode masculinizar as mulheres), doenças gastrintestinais como: colite ulcerativa, ileíte regional, doença celíaca, afecções dos pés (bursite, 2 hallux rigidus, 5º dedo varo), afecções necessitando de injeções subconjuntivais, transtornos hematológicos que respondem aos corticosteroides, alterações dos rins como: síndrome nefrítica e síndrome nefrótica. A insuficiência adrenocortical primária ou secundária poderá ser tratada com dipropionato de betametasona + fosfato dissódico de betametasona, mas deverá haver suplementação com mineralocorticoides. 
O dipropionato de betametasona + fosfato dissódico de BETAMETASONA é recomendado para: 
1) injeções intramusculares para doenças que respondem aos corticoides sistêmicos; 
2) injeções diretamente nos tecidos moles afetados, quando indicado; 
3) injeções intra-articulares e periarticulares em artrites; 
4) injeções intralesionais para várias condições dermatológicas e; 
5) injeções locais para certos transtornos inflamatórios e císticos dos pés. O dipropionato de betametasona + fosfato dissódico de betametasona é uma associação de ésteres de betametasona que produzem efeito anti-inflamatório, antialérgico a antirreumático. A ação imediata é fornecida pelo fosfato dissódico de betametasona, que é rapidamente absorvido após a administração. A ação prolongada é promovida pelo dipropionato de betametasona que, por ser de absorção lenta, controla os sintomas durante longo período de tempo. O tamanho reduzido do cristal de dipropionato de betametasona permite o uso de agulha de fino calibre (até calibre 25) para administração intradérmica e intralesional. 
O dipropionato de betametasona + fosfato dissódico de betametasona é uma suspensão aquosa injetável estéril de dipropionato de betametasona e fosfato dissódico de betametasona. Cada mL de dipropionato de betametasona + fosfato dissódico de betametasona contém 5 mg de betametasona como dipropionato e 2 mg de betametasona como fosfato dissódico, em veículo estéril tamponado e conservado. Os glicocorticoides, como a betametasona, causam profundos e variados efeitos metabólicos e modificam a resposta imunológica do organismo a diversos estímulos. Este medicamento é contraindicado para pacientes que já tiveram qualquer alergia ou alguma reação incomum como hipersensibilidade ao dipropionato de betametasona, fosfato de dissódico de betametasona, a outros corticoides ou a qualquer um de seus componentes da fórmula. Também é contraindicado em pacientes com infecções sistêmicas por fungos. O dipropionato de betametasona + fosfato dissódico de betametasona não deverá ser administrado por via intramuscular em pacientes com púrpura trombocitopênica idiopática.

Tamarine Geleia Zero Açúcar combina o poder das plantas medicinais para trazer alívio para prisão de ventre e auxiliar a preparação de exames radiológicos e endoscópicos. Com uma apresentação agradável e de fácil consumo, é uma alternativa segura, eficiente e prática para fazer seu intestino trabalhar.
O que é Tamarine Geleia Zero Açúcar?
Ideal para aqueles dias em que seu intestino não funciona, Tamarine Geleia Zero Açúcar é um medicamento fitoterápico, preparado a partir de plantas medicinais e ingredientes naturais, capaz de promover ação laxante para aliviar a prisão de ventre.
Sua fórmula combina duas plantas muito importantes, Cassia fistula L. e Senna alexandrina Mill., responsáveis pela ação laxante sem a necessidade de adição de compostos químicos, o que auxilia a usar o medicamento com mais segurança por mais pessoas
Ele é indicado para uso adulto e pediátrico a partir dos 12 anos de idade. Também tem consumo liberado sob prescrição médica para diabéticos, gestantes e lactantes.
Para que serve Tamarine Geleia Zero Açúcar?
Indicado para tratar os sintomas de intestino preso, Tamarine Geleia serve para aliviar a prisão de ventre  e pode ser utilizado para evacuar o trato intestinal como parte da preparação de exames de radiografia, colonoscopia e outros.
Dessa forma, pode diminuir o incômodo de cólicas abdominais ao estimular o funcionamento do organismo.
6 benefícios de Tamarine Geleia Zero Açúcar
A Geleia Tamarine Zero Açúcar conta com diversos benefícios para ajudar você a se livrar dos sintomas da prisão de ventre. Confira:
1. Ação previsível de 8 a 10h: ideal para você se planejar na hora de consumir o laxante;
2. Dosagem facilitada: acompanha colher dosadora para controlar com precisão e facilidade a dose ingerida;
3. Age em todo tipo de constipação: ajuda a tratar os sintomas mais leves até as prisões de ventre mais resistentes;
4. Textura e sabor: a textura de geleia e o sabor natural de ameixa facilita o consumo;
5. Zero açúcar: não contém adição de açúcares, permitindo o uso por diabéticos e demais pacientes com restrições alimentares relacionadas;
6. Consumo liberado: pode ser utilizado por crianças acima de 12 anos de idade e adultos, incluindo gestantes e lactantes.

ANTHELIOS AIRLICIUM FPS30 50g ANTHELIOS AIRLICIUM FPS30
Anthelios Airlicium FPS30 de La Roche-Posay é indicado para pele oleosa ou acneica, sensível ao sol. Possui textura gel-creme, toque limpo, leve e de rápida absorção. A pele é protegida e todas as causas do brilho (oleosidade e umidade) são controladas, proporcionando uma sensação de pele limpa e fresca durante todo o dia. Com alta proteção, possui micropartículas matificadoras encapsuladas com 99% de ar, assim, não pesa sobre a pele, oferecendo um controle perfeito do brilho toda vez que a pele produz oleosidade ou umidade. 
- Alta proteção UVB/UVA e danos causados pela poluição;
- Textura gel-creme, toque seco e leve, de rápida absorção;
- Controle inteligente da oleosidade e umidade com a tecnologia Airlicium; 
- Promove sensação de pele limpa por 9h;
- Pele sem brilho, sem toque engordurado e sem sensação de filme oleoso.Anthelios Airlicium FPS30, de La Roche-Posay, protege a pele contra os raios UVB/UVA e contra os danos da poluição, além de controlar a oleosidade do rosto, a medida que ele a produz. 

Tecnologia Airlicium: Micropartículas matificantes encapsuladas em 99% de ar.Oferecem o controle inteligente do brilho, ativado dinamicamente toda vez que a pele produz oleosidade ou umidade Recomendações de Uso: Modo de Usar:
Aplique abundantemente sobre a pele 30 minutos antes da exposição ao sol. Se a quantidade aplicada não for adequada, o nível de proteção será significativamente reduzido. É necessária a reaplicação do produto para manter a sua efetividade

Reaplique sempre, após sudorese intensa, nadar ou secar-se com a toalha e durante a exposição ao sol. 

Para crianças menores de 6 meses, recomenda-se consultar um médico antes da aplicação do produto.
Condições da pelePELE OLEOSA

