O que é e para que serve? 
Um absorvente externo de fluxo leve para uso durante o período menstrual.

Benefícios e diferenciais
- Com cápsulas superabsorventes que garantem rápida absorção e reduzem o contato com o fluxo;
- Até 6h de proteção contra vazamentos;
- Tecnologia exclusiva que neutraliza odores;
- Hipoalergênico e Ginecologicamente Testado;
- Cobertura Suave.

Como usar 
1) Retire a fita adesiva central do absorvente e das abas (se houver);
2) Fixe o absorvente no centro da calcinha, ajustando as abas por baixo da mesma. 

Precauções 
Todos os componentes são atóxicos em contato com a pele. Descontinuar o uso em caso de irritação. Não compre se a embalagem estiver violada. Conservar em local fresco e seco. Manter longe do alcance das crianças.

