A saúde bucal infantil bem cuidada pode prevenir possíveis cáries e outras complicações futuras. Por isso, torne o momento de escovação das crianças mais divertido com a pasta de dente Oral-B® Kids. 
Dê a seus filhos a proteção contra cáries que eles precisam com um delicioso sabor de goma de mascar. A pasta de dente infantil com flúor impede o aparecimento de problemas bucais e combate a cárie. Além de limpar suavemente cuidando das gengivas e protegendo o esmalte do dente das crianças. 
• Pasta de dente infantil com flúor; 
• Combate a cárie com Fluoristat® (clinicamente comprovada); 
• Limpa gentilmente, cuidando da gengiva e protegendo o esmalte; 
• Pasta com brilho e sabor divertido para as crianças; 
• Sem açúcar; 
• *Flouristat® é uma marca comercial registrada para um composto anti-cárie.

ANTHELIOS 
HYDRAOX SEM COR  50mlO Anthelios Hydraox, de La Roche-Posay, é um protetor solar anti-idade com FPS 60, que oferece cuidado diário com uma fórmula completa, indicado para: pele mista, normal ou seca. Sua textura é fluida ultra leve, com cabamento invisível e ultra resistente à água e ao suor. Não pegajoso e nem oleoso. Com alta concentração de água termal de LA ROCHE-POSAY e vitamina E. Toque seco e acabamento invisível sem resíduos brancos.
Benefícios:
-Previne o envelhecimento;  
- Acabamento invisível;  
- Textura Fluida;
